import React, { useCallback, useState } from "react";
import "./modal.css";

const Modal = (props) => {
  const { open, close, header, button } = props;
  return (
    <div className={open ? "openModal modal" : "modal"}>
      {open ? (
        <section>
          <header>{header}</header>
          <main>{props.children}</main>
        </section>
      ) : null}
    </div>
  );
};

export default Modal;
